    false,nt"url": null,nt"notes": "KR305b 1994 coverage, used to support water
    quality programs, references water quality use designations and support levels.
    The KR305b 1994 coverage is available for the Kansas Lower Republican basin. Kansas
    Uses and the National Pollution Discharge Elimination System (NPDES) coverage, are
    both used to support water quality programs. The Kansas Uses coverage references
    water quality use support designations across the state, and the NPDES coverage
    is a partial representation of the major and minor treatment facility locations
    across Kansas. The Landfills coverage, used to support the environmental quality
    program, references solid waste landfill sites and waste management practices across
    the state. Each coverage's data is current as of publication date. The related KDHE
    operational databases are dynamic databases.",nt"license_title": null,nt"extras":
